import React from 'react'

function Search({event, search}) {
    return (
        <section className="search-box-wrap">
            <input 
                type="text" 
                placeholder="Please type search term here i.e Titanic" 
                className="search-box" 
                onKeyPress={search}
                onChange={event}></input>
            {/* <label>{prop.id}</label> */}
        </section>
    )
}

export default Search
